import React from 'react';
import axios from 'axios'
import Paperbase from './dashboard/Paperbase'
import Login from './registrations/Login'
import {BrowserRouter, Switch, Route} from 'react-router-dom'

const Home = (props) => {

  const handleClick = () =>{

    axios.delete('http://localhost:3001/logout', {withCredentials: true})
    .then(response => {
      props.handleLogout()
      props.history.push('/')
    })
    .catch(error => console.log(error))
  }

  const renderDashboard = () => {
    return (
      <Route 
      exact path='http://localhost:3000/dashboard' 
      render={props => (
      <Paperbase {...props} logout={() => handleClick()} user={props.user} properties={props.properties} />
      )}
    />

    )
  }


  return(
    <div>
      { props.loggedInStatus ? renderDashboard() : 
      <Login setValueAccess={props.setValueAccess} 
      loggedInStatus={props.loggedInStatus} 
      handleLogin={props.handleLogin} />
    }
    </div>
  );
};

export default Home;
